class Transcription:
    def __init__(self):
        pass

    def replaceTWithU(self,inputString):
        return inputString.replace('T','U')

    def transcribe(self,inputString):
        return self.replaceTWithU(inputString)

def main():
    inputString = ''
    transcript = Transcription()
    print(transcript.transcribe(inputString))

if __name__ == "__main__":
    main()